import styled from 'styled-components';

export const Container = styled.div`
    height:50px;
    background-color:#000000;
    color: #FFFAFA;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 15px;

    h1 {
        text-decoration: none;
    }
`;
